            - 剩余工作量：50%
            - 约束条件：客户要求按时交付，团队士气低落
            
            **核心矛盾：** 按当前进度需要2个月才能完成剩余工作，但只有1个月时间
          `,keyInsights:["明确时间和进度的矛盾","识别多重约束条件","理解问题的紧迫性"]},{title:"构思方案",content:`
            **类似问题：** 这类似于资源调度和危机管理问题
            
            **可能的策略：**
            1. **范围调整：** 与客户协商，优先交付核心功能
            2. **资源增加：** 临时增加人手或外包部分工作
            3. **流程优化：** 并行开发，减少等待时间
            4. **质量权衡：** 先交付MVP，后续迭代完善
            
            **选择策略：** 综合考虑成本、质量、时间三要素，制定混合方案
          `,keyInsights:["识别多种可能的解决路径","考虑各种约束和权衡","制定综合性解决方案"]},{title:"执行方案",content:`
            **第一周：危机沟通**
            - 与客户坦诚沟通，重新定义MVP范围
            - 团队会议，重新分配任务，提升士气
            - 识别可以并行进行的工作
            
            **第二周：资源调配**
            - 临时增加2名开发人员
